import React from "react";
import homeView from "../imgs/homeView.svg";
import Grid from "@material-ui/core/Grid";

export default function Welcome() {
  return (
    <div>
      <Grid>
        <h2>Create and track your projects</h2>
      </Grid>
      <Grid>
        <img
          src={homeView}
          style={{
            width: "40em",
            // float: "right",
            marginRight: "3em",
            marginBottom: "3em",
          }}
          alt="Home page image"
        />
      </Grid>
    </div>
  );
}
